function [lambda, l] =  solver_rect_cos_222_refine(x1,s1,c1,x2,s2,c2,iters)

if nargin < 7
    iters = 5;
end

if size(x1,1) == 3
    x1 = x1(1:2,:);
    x2 = x2(1:2,:);
end


% Rescale the scale
scale_scale = (abs(s1)+abs(s2))/2;
s1 = s1 ./ scale_scale;
s2 = s2 ./ scale_scale;

data = [x1 x2];
d = sum(data(1:2,:).^2);

% Rescale line and lambda unknowns
scale_line = mean(abs(data(1:2,:)),2);
scale_lambda = mean(d);

data(1:2,:) = diag(1./scale_line)*data(1:2,:);
data = [data; s1 s2; c1 c2; d / scale_lambda];

sols = solve(data);

sols = refine_roots(data,sols,iters);

sols = real(sols(:,max(abs(imag(sols)))<1e-6));

% Revert rescaling
lambda = sols(1,:) / scale_lambda;
l = diag(1./scale_line) * sols(2:3,:);


function [sols] = refine_roots(data,sols,iter)
x1 = data(1:2,1:3); x2 = data(1:2,4:6);
s1 = data(3,1:3); s2 = data(3,4:6);
c1 = data(4,1:3); c2 = data(4,4:6);
dd1 = data(5,1:3); dd2 = data(5,4:6);

for k = 1:size(sols,2)

    for ii = 1:iter
        lambda = sols(1,k);
        l = sols(2:3,k);

        n1 = s1.*(c1-lambda*dd1);
        n2 = s2.*(c2-lambda*dd2);
        d1 = c1+l.'*x1+lambda*dd1;
        d2 = c2+l.'*x2+lambda*dd2;

        g_n1 = [-s1.*dd1; zeros(2,3)].';
        g_n2 = [-s2.*dd2; zeros(2,3)].';

        g_d1 = [dd1.' x1.'];
        g_d2 = [dd2.' x2.'];

        J = g_n1 .* (d2.^3.'*[1 1 1])+3*((n1.*d2.^2).'*[1 1 1]) .* g_d2;
        J = J - (g_n2 .* (d1.^3.'*[1 1 1])+3*((n2.*d1.^2).'*[1 1 1]) .* g_d1);
        res = n1.*d2.^3 - n2.*d1.^3;
        dx = -J \ res.';
        sols(:,k) = sols(:,k) + dx;
    end
end



